import Right from "../components/rightbtn";
import Left from "../components/leftbtn";
import "./wrapped.css";
import { useEffect, } from "react";
function Final(props){
    // useEffect(() => {
    //     setTimeout(() => {
    //       window.location.href="/wrapped/2"
    //     }, 30000)
    //   }, [])
    return(
        <>
        <div className="one">
            <Left path="#slide4"></Left>
            <Right  path="#slide2"></Right>
        </div>
        <div className="w-full flex final">
            <div className="w-1/2 "></div>
            <div className="w-1/2 flex">
                <div className="titles w-full">
                <h2>Favorite Languages</h2>
                    <ol>
                    <li>Java</li>
                    <li>ks</li>
                    <li>python</li>
                    <li>c</li>
                    <li>fghj</li>

                    </ol>
                </div>
                <div className="titles"></div>
            </div>
        </div>
        </>
    )
}
export default Final;
